vl.setData(GaussCode={[-1,-2,3,-8,7,1,-4,6,-5,4,-6,5,8,-3,2,-7]}, ...
    ori=[-1,1,1,1,-1,1,1,1])
vl.plot();
%%

vl.setData(GaussCode={[-1,-8,-2,3,9,1,-4,-6,-5,4,6,5,8,7,-3,2,-7,-9]}, ...
    ori=[-1,1,1,1,-1,-1,1,1,1])
mat2str(vl.getPDCode)
vl.plot
%%
vl.setData(PD=[1 6 2 7;3 17 4 16;15 5 16 4;17 15 18 14;2 14 3 7;18 6 1 5])
[gc,ori]=vl.getGaussCode
vl.plot()
%%
vl.setData(Gauss= {[6 -1 5 -2 3 -6 1 -5 4 -3 2 -4]},ori=[-1	1	1	-1	-1	-1])
vl.plot() %[output:8be8be1c] %[output:5e66b7f2]
%%
vl.setData(table=[6 2])
[gc,ori]=vl.getGaussCode
dic=dictionary(1:6,[6,1,5,2,4,3]);
dic=dic.insert(-dic.keys,-dic.values);
dic(gc{1})
%%
vl.setData(GaussCode={[-1,-8,-2,3,9,1,-4,-6,-5,4,6,5,8,7,-3,2,-7,-9]}, ...
    ori=[-1,1,1,1,-1,-1,1,1,1])
vl.plot
%%
T=combinations([-1,1],[-1,1],[-1,1],[-1,1]);
for ii=1:height(T)
    a=T{ii,:};
    try
vl.setData(GaussCode={[-1,-2,-8*a(3),3,9*a(4),1,-4,6*a(1),-5,4,-6*a(1),5,-7*a(2),8*a(3),-3,7*a(2),2,-9*a(4)]}, ...
    ori=[-1,1,1,1,-1,a])
vl.plot();
    catch
        disp([ii a])
    end
end
